INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256226751791', 'US box mini penne et boulettes', 'Pâte alimentaire mini penne cuite, sauce barbecue et préparation de viande de porc et de viande bovine assaisonnée cuite 270g : Pâte alimentaire mini penne cuite 57% (eau, semoule de BLE dur), préparation de viande de porc et de viande bovine assaisonnée cuite 14% [viande de porc (origine : France) 9%, viande bovine (origine : France) 3%, eau, oignon frit (oignon, huile de tournesol), fécule de pomme de terre, sel, sucre caramélisé], eau, double concentré de tomate 8%, sucre, huile de tournesol, vinaigre d alcool, fond de volaille aromatisé en poudre (maltodextrine, arômes naturels, graisse et viande de poulet, sel, fécule de pomme de terre, LACTOSE, extrait d\'oignon), sel, arôme naturel de curcuma, pulpe d ail, colorant : caramel ordinaire, oignon en poudre, arôme naturel, épaississant : gomme xanthane, poivre. Pourcentages exprimés sur les pâtes alimentaires mini penne cuite, sauce barbecue et préparation de viande de porc et de viande bovine assaisonnée cuite. Soit 25% de sauce barbecue dans le produit. Emmental râpé (LAIT) 10g.', 'https://static.openfoodfacts.org/images/products/325/622/675/1791/front_fr.19.400.jpg', '5.5', '2.1', '25', '7.1', '', '7.2', '0.78', '0.307086614173228', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3256226751807', 'Us box Mexican riz et poulet sauce salsa', 'Riz cuit préparé aux poivrons et émincé de filet de poulet traité en salaison cuit rôti 250g : Riz cuit 57% (eau, riz), émincé de filet de poulet traité en salaison cuit rôti 14% [filet de poulet (origine : France) 13%, eau, fécule de manioc, sel, dextrose], oignon préfrit (oignon, huile de tournesol), poivron rouge 8%, poivron jaune 8%, huile de tournesol, sel, paprika, cumin, poivre, piment fort. Pourcentages exprimés sur le riz cuit préparé aux poivrons et émincé de filet de poulet traité en salaison cuit rôti. Sauce à base de tomate 30g : Eau, oignon 13%, poivron vert 13%, purée de tomates double concentrée 13%, vinaigre d\'alcool, sucre, amidon de maïs, sel, ail, préparation aromatique 1% (sel, épices et plantes aromatiques, poivron, colorant : extrait de paprika, arômes naturels), coriandre, plantes aromatiques, jus de citron concentré, cumin, conservateur : sorbate de potassium. Pourcentages exprimés sur la sauce à base de tomate.', 'https://static.openfoodfacts.org/images/products/325/622/675/1807/front_fr.20.400.jpg', '2.5', '0.3', '18', '1.9', '', '5.1', '0.71', '0.279527559055118', '', '1');

