VALUES ('3256226751814', 'Oriental box semoule légumes et falafels', 'Semoule de blé dur réhydratée, légumes et falafels frits 250g : Semoule de BLÉ dur réhydratée 45% (semoule de BLÉ dur 22%, eau), falafel frit 18% [pois chiche cuit 5% (pois chiche sec, eau, sel), oignon réhydraté (eau, oignon déshydraté), CRÈME (CRÈME, stabilisant : carraghénanes), farine de BLÉ, eau, protéines et amidon de BLÉ (GLUTEN de BLÉ, amidon de BLÉ), huile de tournesol, OEUF entier en poudre, pulpe d ail, sel, coriandre, persil, poudres à lever (diphosphates, carbonates de sodium, amidon de BLÉ), cumin, curcuma, poivre blanc], aubergine grillée 6%, courgette grillée 6%, oignon préfrit 6% (oignon, huile de tournesol), poivron jaune 6%, poivron rouge 6%, huile de tournesol, sel, menthe, cannelle, cumin, poivre. Pourcentages exprimés sur la semoule de blé dur réhydratée, légumes, et falafels frits. Sauce au yaourt et à la menthe 30g : Eau, huile de colza, YAOURT nature 10%, vinaigre d\'alcool, amidon de maïs, jaune d OEUF, menthe 2%, sel, persil, ail, épaississant : gomme xanthane, poivre, conservateur : sorbate de potassium. Pourcentages exprimés sur la sauce au yaourt et à la menthe.', 'https://static.openfoodfacts.org/images/products/325/622/675/1814/front_fr.19.400.jpg', '8.3', '1.1', '20', '1.9', '', '5.1', '0.78', '0.307086614173228', '', '1');

