VALUES ('3256226756727', 'Paëlla au poulet, moule du Pacifique, chorizo et riz cuisiné', 'Eau, riz 21%, émincé de filet de poulet traité en salaison cuit 15% [filet de poulet (origine : France) 12%, amidon transformé de tapioca, sel, dextrose, épaississant : carraghénanes], tomate pelée concassée au jus (tomate, jus de tomate, acidifiant : acide citrique), MOULE du Pacifique décoquillée cuite (Mytilus Chilensis, élevée au Chili) 3%, chorizo 3% [viande et gras de porc (origine : France), sel, dextrose, piments, épices et extrait d\'épices, ferments, conservateurs : ascorbate de sodium et nitrite de sodium], petit pois 2%, poivron rouge 2%, huile de colza, préparation pour assaisonnement déshydratée (sel, arômes naturels, épices et plantes aromatiques, maltodextrine, sucre, extrait de CRUSTACES), oignon frit déshydraté (oignon, huile de tournesol), amidon transformé de pomme de terre, colorants : curcumine et extrait de paprika, arôme naturel, extrait de vin blanc, persil, épaississant : gomme xanthane, ail en poudre, piment doux fumé déshydraté. Soit 77% de riz cuisiné dans le produit. Traces éventuelles d\'arachides, céleri, céréales contenant du gluten, fruits à coque, graines de sésame, lait, lupin, moutarde, oeufs, poissons et soja.', 'https://static.openfoodfacts.org/images/products/325/622/675/6727/front_fr.11.400.jpg', '4', '0.9', '19', '0.9', '1.5', '7.6', '0.9', '0.354330708661417', '', '1');

