VALUES ('3256226756734', 'Couscous légumes poulet semoule de blé et merguez', 'Eau, mélange de légumes 22% (carotte, courgette, navet, pois chiche, CELERI branche), haut de cuisse de poulet (origine : France) 20%, semoule de BLE dur 15%, merguez précuite 7% [viande de boeuf (origine : France) 6%, gras de boeuf (origine : France), épices et plantes aromatiques, sel, dextrose, LACTOSE, colorant : rouge de betterave, antioxydant : ascorbate de sodium, arômes naturels, conservateur : nitrite de sodium], huile de tournesol, double concentré de tomate, raisin sec 1% (raisin, huile de coton), sel, arôme naturel de paprika, épices et plantes aromatiques, arôme naturel, épaississant : gomme xanthane.', 'https://static.openfoodfacts.org/images/products/325/622/675/6734/front_fr.10.400.jpg', '7.5', '1.8', '14', '2.3', '1.4', '7.9', '0.95', '0.374015748031496', '', '1');

