VALUES ('3256226766269', 'Sandwich au pain mie spécial tex mex garni de filet de poulet mariné,d\'une sauce tomate épicée et de salade', 'Pain mie tex-mex 46% [farine de BLE (France) 26%, eau, huile de colza, concentré de tomates, sucre, levure, sel, épices (paprika 0,3%, piment 0,08%), émulsifiant : mono- et diglycérides d\'acides gras, agent de traitement de la farine : acide ascorbique], poulet traité en salaison et rôti* 24% [filet de poulet (origine : France) 20%, eau, fécule de manioc, dextrose, sel], salade 10%, sauce tomate aux légumes 8,7% [tomate (tomate pelée concassée et jus de tomate), eau, poivron rouge, courgette, oignon, concentré de tomate, amidon transformé de manioc, olive noire, huile d\'olive vierge, câpre au vinaigre (câpre, eau, vinaigre d\'alcool, sel), épices et aromates, filet d ANCHOIS (dont sel), extrait de vin blanc distillé, sel, vinaigre de vin rouge, arôme naturel, sucre], ketchup (tomates, sucre, vinaigre, amidon transformé, sel, arômes), marinade barbecue [sucre, poudre de tomate, sel, sucre caramélisé (sirop de sucre caramélisé, maltodextrine de pomme de terre), arôme (dont arôme de fumée), extrait de levure, poudre de vinaigre d alcool, poudre d oignon, poudre d ail, extrait de paprika, poivre], purée de piments 0,8% (piments, sel, correcteur d\'acidité : acide acétique), jus de citron, huile de colza, marinade tex-mex 0,3% [sel, épice, chapelure (farine de BLE, sel, levure), dextrose, poudre d ail, extrait de paprika, extrait de levure], fécule de manioc, piment doux en poudre 0,1% (piment doux, antioxydant : extrait de romarin), poivre blanc. * Ingrédient décongelé, ne pas recongeler. Traces éventuelles de crustacés, lait, moutarde, oeuf, graines de sésame et soja.', 'https://static.openfoodfacts.org/images/products/325/622/676/6269/front_fr.20.400.jpg', '4.1', '0.5', '27', '5', '', '10', '1.5', '0.590551181102362', '', '0');

